package operator;

public class IncDecOP2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int m =50,n=30;
		System.out.printf("%d %d %n",m--,n++);
		System.out.printf("%d %d %n",m,n);
		System.out.printf("%d %d %n",--m,++n);
		System.out.printf("%d %d %n",m,n);
	}

}
